    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
    % basics
    square/.style={draw, regular polygon, regular polygon sides=4},
    triangle/.style={draw, regular polygon, regular polygon sides=3},
  }

  \tikzset{
    % string diagrams
    state/.style={triangle, shape border rotate=180, anchor=north},
    costate/.style={triangle, anchor=south},
    morphism/.style={draw, rectangle},
    over/.style={
      draw=white,
      double=black,
      % default is .4pt
      line width=1.2pt,
      double distance=.4pt,
      text=black
    },
  }

  \tikzset{ 
    % tables
    % https://tikz.net/tikz-table/
    table/.style={
        matrix of nodes,
        row sep=-\pgflinewidth,
        column sep=-\pgflinewidth,
        nodes={
            rectangle,
            draw=black,
            align=center
        },
        minimum height=1.5em,
        text depth=0.5ex,
        text height=2ex,
        nodes in empty cells,
%%
        every even row/.style={
            nodes={fill=gray!20}
        },
        column 1/.style={
            nodes={font=\bfseries}
        },
        row 1/.style={
            nodes={
                fill=black,
                text=white,
                font=\bfseries
            }
        }
    }
  }

  \begin {tikzcd}
			C^\text {op}\times  C\ar [rr, "{C(-, -)}"] && \textsc {Set} \\
			x,z\ar [rr, mapsto]\ar [shift left=2, dd, "g"] && C(x,z)\ar [dd, "f^*g_*"] &&
			x\ar [rrr, "h"] &\ar [dd, shift left=8, mapsto] && z\\
			\hspace {1.8em}\ar [rr, mapsto, shift right=1] && \hspace {0em}\\
			y,w\ar [rr, mapsto]\ar [shift left=2, uu, "f"] && C(y,w) && y\ar [r, "f"'] &
			x\ar [r, "h"'] & z\ar [r, "g"'] & w\makebox [0pt][l]{.}
  \end {tikzcd}

